  //     checked: false,
  //   },
    
  // ]

  render() {
    if (this.affairs.length > 0) {
      return (
        <div>
          {this.affairs.map((el) => (
            <div className='affair' key={el.id}>
              <h3>{el.data}</h3>
              <h4>{el.time}</h4>
              <p className='paragraph'>{el.text}</p>
            </div>
          ))}
        </div>
      )
    } else {
      <div>
         
            <div className='affair'>
              <h3 className=''>Поздравляю, все задачи выполнены</h3>
            </div>
        
        </div>
    }
    
  }
}
